import React from "react";
import { Button } from "./Nav.js";

export class Form extends React.Component {
  constructor(props) {
    super(props);

  }



  render() {

    const errMes = "Wrong Password";
    return (
      <form id="form">
        <input></input>
        <Button name="submit" onClick={this.errMes} />
      </form>
    );
  }
}
